let highlight=({activeClass:activeClass="active",container:container,highlightParent:highlightParent=false,parentLevels:parentLevels=1})=>{let links,element;try{links=document.querySelector(container).querySelectorAll("a")}catch(e){throw"container element not give"}for(const key of links){element=key;if(key.href===window.location.href){if(highlightParent){for(i=0;i<parentLevels;i++){element=element.parentElement}element.classList.add(activeClass)}else{key.classList.add(activeClass)}}}};